import React,{ useEffect }  from 'react';
import {useDispatch, useSelector} from 'react-redux';
import {fetchLatestPlayers} from '../redux/player/actions';
import {ListGroup}  from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './List' 



const ListLatestPlayers = props => {

    const dispatch = useDispatch();
    const players = useSelector(state => state.players.latestPlayers)

    useEffect(() => {
        dispatch(fetchLatestPlayers())
    },[dispatch]);

    
    return (
        <div className='list-latest-players'>
            <ListGroup>
                {players.map((player,index) =>
                <div key={index} className='mb-2 list'>
                    <Link to = {'player/' + player.id}>
                        <ListGroup.Item  key='index'>
                            {player.nickname}
                        </ListGroup.Item>
                    </Link>
                </div>
                )}
            </ListGroup>
        </div>
    );
};

export default ListLatestPlayers;
